import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";

const pageOne = () => {
  return <div>paage 1</div>;
};

const pageTwo = () => {
  return <div>page two</div>;
};

const App = () => {
  return (
    <div>
      <Route path="/" exact component={pageOne} />
      <Route path="/pageTwo" component={pageTwo} />
    </div>
  );
};

export default App;
